import React from 'react'
import './PostJobs.css'

const PostJobs = () => {
  return (
    <div className='postJobs'>
    <div className="post-box">

    <div className="top">
       <p>Get started with your job post</p>
    </div>

    </div>
    </div>
  )
}

export default PostJobs;
